import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ImageService {
  constructor() {}

  // Simulating an API call that returns a base64 image
  getBase64FlightLogo(): string {
    return `data:image/png;base64,`;
  }
  getBase64WorldLogo(): string {
    return `data:image/png;base64,`;
  }

  getBase64Signature(): string {
    return `data:image/png;base64,
`;
  }
}
